import { Outlet } from "react-router-dom";
import Header from "../Header";

function LayoutDefault() {
  return (
    <>
      <Header />
      <main>
        <Outlet />
      </main>
      <footer>Copyright @ 2025 by Minh Hieu</footer>
    </>
  );
}

export default LayoutDefault;
